  const routerObject = router;

  console.log(routerObject.asPath);

  const querry = routerObject.asPath.split("/")[2];

  console.log(querry);

  axios
    .get("http://localhost:3400/api/containers/getcontainers", {
      params: {
        location: querry,
      },
    })
    .then((response) => {
      console.log(response);
    });

